import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';

class Square extends React.Component {
	render() {
		return (
		<div>
			{this.props.value}
		</div>
	)
	}
}

class Board extends React.Component {

	renderSquare(value, className) {
		return (
			<Square
				className={className}
				key={value}
				value={value}
			>
			</Square>
		)
	}

	getBoard() {
		let squares = [];
		for (let i = 0; i < 9; i ++) {
			squares.push(this.renderSquare(i));
		}
		return squares
	}

	render() {
		return (
			<div>
				{this.getBoard()}
			</div>
		);
	}
}


class Game extends React.Component {
	render() {
		return (
			<div>
				<Board>
				</Board>
			</div>
		)
	}
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
	<Game></Game>
);
